import {withAmp} from 'next/amp'
import React from 'react'
import Head from 'next/head'
const exclusive = (props) => (
    <div>
        <Head>
            <style amp-custom>
                {`
                    .addtocart_teal_banner{
                        background-color: #52bdae;
                        width: 100%;
                        height: 50%;
                        color: white; 
                        font-family: -apple-system, BlinkMacSystemFont, sans-serif;
                    }
                    .teal_banner_line1{

                        padding-left:13%;
                        padding-top: 4%;
                        margin-bottom: 10px;
                        font-size: 18px;
                        position: relative;


                    }
                    .teal_banner_line2{

                        padding-left:45%;
                        margin-top: 5px;
                        font-size: 18px;
                        position: relative;
                        font-size: 21px;
                    }
                    .teal_banner_line3{
                        font-size:1.7em;
                        padding-left:12%;
                        padding-top:2%;
                        font-weight: bold;

                    }
                `}
            </style>
        </Head>
        <body>
            <div class="addtocart_teal_banner">
                <p>
                    <p class="teal_banner_line1"> BECOME AN EXCLUSIVE MEMBER </p>
                    <p class="teal_banner_line2"> AT AN </p>
                    <p class="teal_banner_line3"> INTRODUCTORY PRICE </p> 
                </p>
            </div>
        </body>
    </div>


)

export default withAmp(exclusive , {hybrid:true})
